import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';
import React, {Component} from 'react';
const mapStyles = {
    width: '80%',
    height: '80%',
    };
class Googlemap extends Component {
    constructor(props) {
      super(props);

      this.state = {
          lat : parseInt(this.props.lat),
          lng : parseInt(this.props.lng),
      }
    }
    componentWillMount(){
        console.log('render google map componentWillMount')
        var lat = this.state.lat
        var lng = this.state.lng
        if( isNaN(lat) && isNaN(lng)){
            console.log('initial value NaN')
            this.setState({
                lat : 39.833851,
                lng : -74.871826
            })

        }


    }
    render() {

      console.log('render google map')
      console.log('this.state in google,',this.state)
      return (

            <Map
            google={this.props.google}
            zoom={8}
            style={mapStyles}
            // initialCenter={{  lat: this.state.lat,
            //     lng: this.state.lng}}>
            //  <Marker position={{ lat: this.state.lat, lng: this.state.lng}} />
            initialCenter={{  lat: this.props.lat,
                lng: this.props.lng}}>
             <Marker position={{ lat: this.props.lat, lng: this.props.lng}} />
          </Map>


      );
    }
  }
  export default GoogleApiWrapper({
    apiKey: 'AIzaSyBmuVFyl548_WfKr2oqchbb4LgEiwHYjEU'
  })(Googlemap);
